fetch("https://api.quotable.io/quotes?limit=5").then((t=>t.json())).then((t=>{const e=document.getElementById("quote-list");t.results.forEach((t=>{const o=document.createElement("li");o.textContent=`${t.author}: "${t.content}"`,e.appendChild(o)}))})).catch((t=>{console.error("Failed to load quotes:",t)}));